import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';

function App() {
  const [todoItems, setTodoItems] = useState(null);

  useEffect(() => {
    // do something on load
    console.log("loaded");

    if (!todoItems) {
      fetch('http://localhost:8080/api/todoItems')
        .then((response) => response.json())
        .then((data) => {
          console.log("Todo Items: ", data)
          setTodoItems(data);
        });
    }
  });

  return (
    <div>
      {todoItems != null ? todoItems.map((todoItem) => {
        return (
          <React.Fragment>
            <input type="checkbox" checked={todoItem.isDone}/><span>{todoItem.task}</span>
          </React.Fragment>
        );
      }) : "loading data..."}
    </div>
  )
}

export default App;
